describe('fetch meeting info and meeting member object', () => {
  it('should fetch meeting info ,member and topics data with discrepncy values', async () => {
    const data = { records: meetingsInfo }
    fetchMeetingsInfodb.mockResolvedValueOnce(data);
    fetchMeetingsMemebersInfodb.mockResolvedValueOnce({ records: meetingsMemebersInfo });
    fetchMeetingTopics.mockResolvedValueOnce([]);
    fetchAccountDetails.mockResolvedValueOnce([]);
    fetchDiscrepancyPicklistValues.mockResolvedValueOnce([{
      label: 'All', value: 'All', detailLayoutSections: [{
        heading: 'Information', layoutRows: [{
          item: 'layoutRows',
          layoutItems: [{
            label: 'Discrepancy Reason',
            value: 'Discrepancy Reason',
            layoutComponents: [{
              details: {
                picklistValues: [{
                  value: 'Meeting contains restricted products',
                  label: 'Meeting contains restricted products'
                }]
              }
            }]
          }]
        }]
      }]
    }]);
    fetchMeetingHighLightPanel.mockResolvedValueOnce(meetingHighLightPanel);
    const slice = makeSlice({
      ...initialState,
      meetingHighLightPanel: meetingHighLightPanel,
      meetingDetails: records,
      meetingProductTopics: [],
    });
    const store = configureStore({
      reducer: {
        meeting: slice.reducer,
      },
    });
    await store.dispatch(fetchMeetingsInfoAsync(`a470k0000010BKIAA2`));
    expect(fetchMeetingsInfodb).toHaveBeenCalled();
  });
  it('should fetch meeting info ,member and topics data', async () => {
    const data = { records: meetingsInfo }
    fetchMeetingsInfodb.mockResolvedValueOnce(data);
    fetchMeetingsMemebersInfodb.mockResolvedValueOnce({ records: meetingsMemebersInfo });
    fetchMeetingTopics.mockResolvedValueOnce([]);
    fetchAccountDetails.mockResolvedValueOnce([]);
    fetchDiscrepancyPicklistValues.mockResolvedValueOnce([]);
    fetchMeetingHighLightPanel.mockResolvedValueOnce(meetingHighLightPanel);
    const slice = makeSlice({
      ...initialState,
      meetingHighLightPanel: meetingHighLightPanel,
      meetingDetails: records,
      meetingProductTopics: [],
    });
    const store = configureStore({
      reducer: {
        meeting: slice.reducer,
      },
    });
    await store.dispatch(fetchMeetingsInfoAsync(`a470k0000010BKIAA2`));
    expect(fetchMeetingsInfodb).toHaveBeenCalled();
  });
});
